import React, { useState } from "react";
import axios from "axios";

function EmployeeForm() {
  // Declare state for form fields
  const [name, setName] = useState("");
  const [employeeId, setEmployeeId] = useState("");
  const [email, setEmail] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [department, setDepartment] = useState("");
  const [dateOfJoining, setDateOfJoining] = useState("");
  const [role, setRole] = useState("");
  const [message, setMessage] = useState(""); // Message for feedback

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault(); // Prevent the default form submission

    const employeeData = {
      name,
      employeeId,
      email,
      phoneNumber,
      department,
      dateOfJoining,
      role,
    };

    try {
      // Send a POST request to the backend to add the employee
      const response = await axios.post("http://localhost:3001/add-employee", employeeData);

      if (response.status === 201) {
        setMessage("Employee added successfully!");
        // Optionally clear the form after successful submission
        setName("");
        setEmployeeId("");
        setEmail("");
        setPhoneNumber("");
        setDepartment("");
        setDateOfJoining("");
        setRole("");
      }
    } catch (err) {
      // Handle errors
      setMessage("Failed to add employee");
      console.error(err);
    }
  };

  return (
    <div className="employee-form-container">
      <h2>Add Employee</h2>
      {message && <p>{message}</p>}
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="name">Name</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="employeeId">Employee ID</label>
          <input
            type="number"
            id="employeeId"
            value={employeeId}
            onChange={(e) => setEmployeeId(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="email">Email</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="phoneNumber">Phone Number</label>
          <input
            type="tel"
            id="phoneNumber"
            value={phoneNumber}
            onChange={(e) => setPhoneNumber(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="department">Department</label>
          <input
            type="text"
            id="department"
            value={department}
            onChange={(e) => setDepartment(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="dateOfJoining">Date of Joining</label>
          <input
            type="date"
            id="dateOfJoining"
            value={dateOfJoining}
            onChange={(e) => setDateOfJoining(e.target.value)}
            required
          />
        </div>

        <div>
          <label htmlFor="role">Role</label>
          <input
            type="text"
            id="role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            required
          />
        </div>

        <button type="submit">Submit</button>
        <button type="reset" onClick={() => setMessage("")}>Reset</button>
      </form>
    </div>
  );
}

export default EmployeeForm;
